import './App.css';
import { Box, 
         Flex } from '@chakra-ui/react';
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <Flex>
        <Navbar />
        <Box
        flex="1"
        p={4}
        bg="gray.100"
        overflowY="auto"
        >


        </Box>
      </Flex>
    </div>
  );
}

export default App;
